INSERT INTO translations (language, key, text, created, created_by, modified, modified_by, user_created) VALUES ('es', 'multi_schema.select_restore.description', 'Use esta opción en caso de desear restaurar un backup existente del Biblivre 4. En el caso de que el Biblivre encuentre backups guardados en sus documentos, usted podrá restaurarlos directamente de la lista siguiente. De lo contrario, usted deberá enviar un archivo de backup (extensión <strong>.b4bz</strong>) a través del formulario.', '2014-07-26 10:56:23.669888', 1, '2014-07-26 10:56:23.669888', 1, false);
