INSERT INTO translations (language, key, text, created, created_by, modified, modified_by, user_created) VALUES ('es', 'multi_schema.restore.restore_partial_backup.description', 'Para restaurar solo algunas bibliotecas, use el formulario siguiente. En este caso usted podrá elegir qué bibliotecas serán restauradas y si ellas sustituirán a las existentes o si serán restauradas como nuevas bibliotecas. Esto es útil para duplicar bibliotecas o verificar si el backup está correcto.', '2014-07-26 10:56:23.669888', 1, '2014-07-26 10:56:23.669888', 1, false);
