INSERT INTO translations (language, key, text, created, created_by, modified, modified_by, user_created) VALUES ('en-US', 'cataloging.bibliographic.automatic_holding_help', '<p>Use the form below to speed up the Copies creation process. This is an optional step and no holding will be created if the form below is left blank. In that case, you can create your holdings in the <em>Copies</em> tab.</p><p>If you want to create the Copies now, the only mandatory field is "Number of Copies". This field will decide the number of copies created for each volume, so, if the bibliographic record has 3 volumes and you set "Number of Copies" as 2, 6 copies will be created, 2 for each volume. If there''s only one volume, fill in the "Volume Number" field, and if there''s no volume, leave both fields blank.</p>', '2014-07-26 12:01:11.320131', 1, '2014-07-26 12:01:11.320131', 1, false);
